import React from 'react';
import './style.css';

function Game (props) {
    return (
        <div className="container">
            <div className="row">
                {props.fruits.map(fruit => (
                    <div className="card">
                        <div className="img-container">
                            <img alt={fruit.name} src={fruit.image} />
                        </div>
                    </div>
                ))}
            </div>
        </div>
    )
};

export default Game;
